@Injectable({
  providedIn: 'root'
})
export class ListaVentasService {

  private ventas: Ventas[] = [];
  ventaSeleccionada: Oferta | null = null;

  constructor() { }

  getListaOfertas(): Oferta[] {
    return this.ofertas;
  }
}
